    false,nt"url": null,nt"notes": "This report contains locations and water
    use at Ouray NWR for 2000. The document begins with a summary of water rights concerning
    Ouray NWR, followed by a brief description of operations and conditions for the
    year. Water use for each feature were then discussed in detail before providing
    tabulated data portraying the total water uses for each feature, the water sources
    that were used, and the pump use. Lastly a planned water use is presented for the
    following year for each feature in Ouray NWR. A table of the pool designations,
    pool capacity surface acres, pool capacity acre feet, and full pool elevation are
    located after two maps of Ouray at the end of the report just before a selenium
    project map.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
